import { BrowserRouter } from "react-router-dom";

const App = () => {
  return (
    <>
    <BrowserRouter>
      <NavigationBar />
      <AppRoute />
      <Motto />
      {/* <Loading /> */}
    </BrowserRouter>
    </>
  );
}


export default App;
